import React from 'react'
import Team from './Team';


export default function Footer(props) {
    return (
        <div style={{marginTop: "55px"}}>
            <footer>
                <div>Powered by</div><Team devTeam={props.devTeam}/>
            </footer>
        </div>
    )
}
